import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import NavbarBasic from './Components/Layout';
import Layout from './Components/Layout'

function App() {
  return (
    <BrowserRouter>
    <NavbarBasic />
      <Routes>
        <Route path='/' element={<Layout />}>

        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
